import React from 'react'
import styled from 'styled-components'



const Wrapper = styled.div`
  width:60vw;
  height:50vh;
  position: fixed;
  background-color: wheat;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  display: flex;
  flex-flow: column wrap;
  align-items: center;  
`

function Currency() {
  return (
    <Wrapper>
      <h2 style={{ marginBottom: '3vh', fontSize: '2.5vw' }}>CURRENCY CONVERTOR</h2>
      <div>
        <input type="text" style={{ lineHeight: '2rem', width: '15vw', marginRight: '2vw' }} />
        <select name="" id="">
          <option value="EUR">EUR</option>
          <option value="EUR">EUR</option>
          <option value="EUR">EUR</option>
        </select>
      </div>
      <img src='../assets/arrow.png' style={{ width: '50', height: '50' }} />
      <span>2341324132</span>
    </Wrapper>
  )
}
export default Currency
